const SearchBar = ({ onSearch }) => {
  return (
    <input
      type="search"
      placeholder="지금 새로운 모임을 찾아보세요!"
      // Implement the onSearch function to handle search logic
      onChange={onSearch}
    />
  );
};

export default SearchBar;
